class Solution:
    def minFallingPathSum(self, arr: List[List[int]]) -> int:
        A = arr
        N, M = len(A), len(A[0])
        INF = 200 * 200 * 100
        dp = [[INF for _ in range(M)] for _ in range(N)]
        for c in range(M):
            dp[0][c] = A[0][c]

        for r in range(1, N):
            mins = list(sorted([(v, i) for i, v in enumerate(dp[r-1])]))
            for c in range(M):
                for i in range(M):
                    if mins[i][1] != c:
                        dp[r][c] = mins[i][0] + A[r][c]
                        break

        return min(dp[N-1])

